import Landing from "./pages/Landing";
import Auth from "./pages/Auth";
import Lecturer from "./pages/lecturer";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Landing />} />
        <Route path="/auth" element={<Auth />} />
        <Route path="/login" element={<lecturer />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
